let camera, scene, renderer, mesh;
init();
animate();
// setup to render scene
function init() {
  let light, geometry, material, meshFaceMaterial;
  scene = new THREE.Scene();

  // vertical field of view, aspect ratio, clip near & far
  camera = new THREE.PerspectiveCamera(70, window.innerWidth / window.innerHeight, 1, 1000);

  // create white light
  light = new THREE.DirectionalLight(0xffffff);
  light.position.set(0, 1, 1).normalize();
  scene.add(light);

    light2 = new THREE.DirectionalLight(0xffffff);
  light2.position.set(0, 1, 0.5).normalize();
    scene.add(light2);
    
  geometry = new THREE.CubeGeometry(20, 20, 20);
//429 287
 
//  material = new THREE.MeshPhongMaterial({ map: THREE.ImageUtils.loadTexture('') });
  material = new THREE.MeshPhongMaterial({ map: THREE.ImageUtils.loadTexture('data:image/jpeg;base64,') });

  // assign different parts of image to different parts of cube
  var four = [new THREE.Vector2(0.666, 0), new THREE.Vector2(0.666, 0.5), new THREE.Vector2(1, 0.5), new THREE.Vector2(1, 0)];

//  var three = [new THREE.Vector2(0.666, 0.5), new THREE.Vector2(0.666, 1), new THREE.Vector2(1, 1), new THREE.Vector2(1, 0.5)];
  var three = [new THREE.Vector2(0.666, 0.5), new THREE.Vector2(0.666, 1), new THREE.Vector2(1, 1), new THREE.Vector2(1, 0.5)];

  var five = [new THREE.Vector2(0.333, 0), new THREE.Vector2(0.333, 0.5), new THREE.Vector2(0.666, 0.5), new THREE.Vector2(0.666, 0)];

  var two = [new THREE.Vector2(0.333, 0.5), new THREE.Vector2(0.333, 1), new THREE.Vector2(0.666, 1), new THREE.Vector2(0.666, 0.5)];

  var six = [new THREE.Vector2(0, 0), new THREE.Vector2(0, 0.5), new THREE.Vector2(0.333, .5), new THREE.Vector2(0.333, 0)];

  var one = [new THREE.Vector2(0, 0.5), new THREE.Vector2(0, 1), new THREE.Vector2(0.333, 1), new THREE.Vector2(0.333, 0.5)];
  //clears UV mapping that already existed
  geometry.faceVertexUvs[0] = [];

  // must be defined in a counter clockwise direction
  geometry.faceVertexUvs[0][0] = [four[0], four[1], four[3]];
  geometry.faceVertexUvs[0][1] = [four[1], four[2], four[3]];

  geometry.faceVertexUvs[0][2] = [three[0], three[1], three[3]];
  geometry.faceVertexUvs[0][3] = [three[1], three[2], three[3]];

  geometry.faceVertexUvs[0][4] = [five[0], five[1], five[3]];
  geometry.faceVertexUvs[0][5] = [five[1], five[2], five[3]];

  geometry.faceVertexUvs[0][6] = [two[0], two[1], two[3]];
  geometry.faceVertexUvs[0][7] = [two[1], two[2], two[3]];


  geometry.faceVertexUvs[0][8] = [six[0], six[1], six[3]];
  geometry.faceVertexUvs[0][9] = [six[1], six[2], six[3]];

  geometry.faceVertexUvs[0][10] = [one[0], one[1], one[3]];
  geometry.faceVertexUvs[0][11] = [one[1], one[2], one[3]];


  mesh = new THREE.Mesh(geometry, material);
  mesh.position.z = -50;
  scene.add(mesh);

//  renderer = new THREE.WebGLRenderer();
  renderer = new THREE.WebGLRenderer({antialias: true});
  renderer.setSize(window.innerWidth, window.innerHeight);
  document.body.appendChild(renderer.domElement);

  render();
}

// hold object state
function animate() {
  mesh.rotation.x += 0.002;
  mesh.rotation.y += 0.03;
  render();
  requestAnimationFrame(animate);
}

// view 
function render() {
  renderer.render(scene, camera);
}